div.script:
  function mycarousel_initCallback(carousel) {
    var scrollStep = 1;
    jQuery('.jcarousel-control a').bind('click', function () {
      //carousel.scroll(jQuery.jcarousel.intval(jQuery(this).text()));
      return false;
    });

    jQuery('.jcarousel-scroll select').bind('change', function () {
      carousel.options.scroll = scrollStep;
      return false;
    });

    jQuery('#mycarousel-next').bind('click', function () {
      carousel.next();
      return false;
    });

    jQuery('#mycarousel-prev').bind('click', function () {
      carousel.prev();
      return false;
    });
  };

  //carousel start and functions
  jQuery(document).ready(function () {
    jQuery("#mycarousel").jcarousel({
      scroll: 1,
      wrap: "circular",
      auto: "5",
      initCallback: mycarousel_initCallback,
      itemVisibleInCallback: { onBeforeAnimation: highlight },
      itemVisibleOutCallback: { onBeforeAnimation: removehighlight },
      // This tells jCarousel NOT to autobuild prev/next buttons
      buttonNextHTML: null,
      buttonPrevHTML: null
    });
  });

  function highlight(carousel, obejctli, liindex, listate) {
    $("#imgPos" + carousel.index(liindex)).attr("src", "../images/core/ScrollerNext.gif");
    $("#lblHeadline" + carousel.index(liindex)).innerHTML = "ASD";
    //$("#Btnslide"+carousel.index(liindex)).css("background-color","#FF0000");
    Cufon.refresh("h4", { ignore: "cufon" });
  };

  function removehighlight(carousel, obejctli, liindex, listate) {
    $("#lblHeadline" + carousel.index(liindex)).innerHTML = "ASD";
    $("#imgPos" + carousel.index(liindex)).attr("src", "../images/core/ScrollerItem.gif");
    //$("#Btnslide"+carousel.index(liindex)).css("background-color","#E3E3E3");
  };

